import React from "react";
import UserItem from "./UserItem/UserItem";
import axios from 'axios';

const userList = props => {

    let users = null;
    let userItems = null;
    
    axios
        .get('http://localhost:8088/api/user')
        .then(response => {
            console.log(response.data);
            users = response.data;
            userItems = users.map((user, index) => (
                <UserItem key = {index} source = {props.source} name = {props.name} age = {props.age} country = {props.country}/>
            ))
            return <div>{userItems}</div>;
        })
        .catch(error => {
            console.log(error);
        });


    return <div>{userItems}</div>;
};

export default userList;
